    while(index < len(ulaz)):
        najveca_duljina = 0
        izvrsi_akciju = None
        
        for akcija in akcije:

            if akcija.stanje == trenutno_stanje:
                akcija.automat.reset()
                akcija.automat.epsilon_prijelaz()

                i = index
